// import logo from './logo.svg';
import { Routes, Route } from "react-router-dom";
import Navbar from './Components/Navbar';
import Home from './Components/Pages/Home.js';
import About from './Components/Pages/About.js';

const App = () => {
  return (
    <>
      <Routes>
        <Route />
        <Navbar />
        <Home />
        <About/>
    </Routes>
    </>
  );
}

export default App;
